//请求方法
const fetcha = (url,data) => {
    fetch(url,{
      method: 'POST', 
      body: JSON.stringify(data),
      headers: new Headers({
        'Content-Type': 'application/x-www-form-urlencoded'
      })
    })
    .then(res => res.json())
}

//初始fetch方法
const fetchb =  function* (url){
  const res = yield fetch(url)

  const data = yield res.json()

  return data

}

//搜索条件匹配fetch方法
const fetchc =  function* (url,data){
  const res = yield fetch(url,{
      method: 'POST', 
      body: JSON.stringify(data),
      headers: new Headers({
        'Content-Type': 'application/x-www-form-urlencoded'
      })
  })
  const data1 = yield res.json()

  return data1

}

//添加key
const change = function(response) {

  for (let k in response){
  response[k].key = response[k].id
  }
  return response

}

//Model 页面
export const model = {

    localhost : "http://localhost:8080/",

    search : function* (fedata,data1){

      const response = yield fetchc(this.localhost+fedata,data1)

      const data2 = yield change(response)

      return data2

    },

    change:function* (fedata,data1){

      yield fetchc(this.localhost+fedata,data1)

      const data2 = yield fetch1()

      return data2
    },

    fetch1:function* (){

      const response = yield fetchb('http://localhost:8080/')

      const data = yield change(response)

      return data   
    }
}
